import React from 'react';
import MyInfo from './MyInfo/MyInfo';
import Posts from './MyPosts/AddPost/Posts';
import FirstBlockPicture from './FirstBlockPicture/FirstBlockPicture';
import './Profile.module.css'



const Profile = () => {
	return <div >
		<FirstBlockPicture/> 
    <MyInfo/>
    <Posts posts={props.posts}/>

	</div>
}



export default Profile
